text:'{"blocks":[{"key":"erv95y","text":"明るく、大胆で、決して引き下がらない——ステファニー・ブラウンはバットガール。かつては“スポイラー”として犯罪と戦い、一時はロビンのマントを纏った彼女は、混沌としたゴッサムの街で自らの道を切り開いてきました。反骨精神と強い意志を持つステファニーは、ユーモアと情熱、そしてタフさをバットガールとして体現しています。一流の戦士たちに鍛えられ、いつも冗談を忘れない彼女は、ヒーローとは完璧であることではなく、何度倒れても決して諦めないことだと証明しているのです。","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":228,"style":"opacity:1"},{"offset":0,"length":228,"style":"hlnke:true"},{"offset":0,"length":228,"style":"backgroundColor:unset"},{"offset":0,"length":18,"style":"fontFamily:\\"MS Mincho\\""},{"offset":20,"length":23,"style":"fontFamily:\\"MS Mincho\\""},{"offset":44,"length":5,"style":"fontFamily:\\"MS Mincho\\""},{"offset":50,"length":178,"style":"fontFamily:\\"MS Mincho\\""},{"offset":0,"length":228,"style":"defaultBackgroundColor:#E8D01B"},{"offset":0,"length":228,"style":"textHighlightEnable:false"},{"offset":0,"length":228,"style":"textShadowEnable:false"},{"offset":0,"length":228,"style":"hlnk:"},{"offset":18,"length":2,"style":"fontFamily:\\"Times New Roman\\""},{"offset":43,"length":1,"style":"fontFamily:\\"Times New Roman\\""},{"offset":49,"length":1,"style":"fontFamily:\\"Times New Roman\\""},{"offset":0,"length":228,"style":"overridden:true"},{"offset":0,"length":228,"style":"hlnkt:wp"},{"offset":0,"length":228,"style":"textOutlineEnable:false"}],"entityRanges":[],"data":{"presetId":"text-body-1","listColor":"#666666","listType":"S_Bullets08","listSize":"100%","listIndent":"100%","listDepth":"0","overridden":"true"}}],"entityMap":{}}',
