text:'{"blocks":[{"key":"2h76w7","text":"アクロバット。リーダー。受け継がれる遺産。サーカスのスターだった孤児ディック・グレイソンは、ブルース・ウェインに引き取られ、最初のロビンとなりました——明るく、大胆で、揺るぎない忠誠心を持つ少年です。バットマンの最初の相棒として、彼はゴッサムの闇に希望をもたらしました。やがて“ナイトウィング”として自らの道を切り開いたディックは、今なおバットファミリーの中心的存在であり、生まれ持ったリーダーシップで思いやりと高いスキルの両立を体現しています。","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":223,"style":"overridden:true"},{"offset":0,"length":223,"style":"hlnkt:wp"},{"offset":0,"length":223,"style":"textOutlineEnable:false"},{"offset":0,"length":223,"style":"opacity:1"},{"offset":0,"length":223,"style":"hlnke:true"},{"offset":0,"length":223,"style":"backgroundColor:unset"},{"offset":0,"length":223,"style":"fontFamily:\\"MS Mincho\\""},{"offset":0,"length":223,"style":"defaultBackgroundColor:#E8D01B"},{"offset":0,"length":223,"style":"textHighlightEnable:false"},{"offset":0,"length":223,"style":"textShadowEnable:false"},{"offset":0,"length":223,"style":"hlnk:"}],"entityRanges":[],"data":{"presetId":"text-body-1","listColor":"#666666","listType":"S_Bullets08","listSize":"100%","listIndent":"100%","listDepth":"0","overridden":"true"}}],"entityMap":{}}',
