text:'{"blocks":[{"key":"gfh5te","text":"ストリート育ち。冷酷。そして、再生。ジェイソン・トッドはゴッサムの荒れた街で育ちましたが、バットマンはその内に秘めた強さに可能性を見出しました。2代目ロビンとして活躍したジェイソンは、大胆で衝動的でした——そして悲劇が彼を襲います。死から蘇り、心を硬くした彼は“レッドフード”として復活し、自分なりの正義を貫き始めました。もはや彼はバットマンの相棒ではありません——彼はその“暗い鏡”なのです。","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":197,"style":"overridden:true"},{"offset":0,"length":197,"style":"hlnkt:wp"},{"offset":0,"length":197,"style":"textOutlineEnable:false"},{"offset":0,"length":197,"style":"opacity:1"},{"offset":0,"length":197,"style":"hlnke:true"},{"offset":0,"length":197,"style":"backgroundColor:unset"},{"offset":0,"length":72,"style":"fontFamily:\\"MS Mincho\\""},{"offset":73,"length":124,"style":"fontFamily:\\"MS Mincho\\""},{"offset":0,"length":197,"style":"defaultBackgroundColor:#E8D01B"},{"offset":0,"length":197,"style":"textHighlightEnable:false"},{"offset":0,"length":197,"style":"textShadowEnable:false"},{"offset":0,"length":197,"style":"hlnk:"},{"offset":72,"length":1,"style":"fontFamily:\\"Times New Roman\\""}],"entityRanges":[],"data":{"presetId":"text-body-1","listColor":"#666666","listType":"S_Bullets08","listSize":"100%","listIndent":"100%","listDepth":"0","overridden":"true"}}],"entityMap":{}}',
